public class TestImplementStrStr {
    ImplementStrStr iss = new ImplementStrStr();

    @Test
    public void testCase() throws Exception {
        assert iss.strStr("", "") == 0;
        assert iss.strStr("a", "a") == 0;
        assert iss.strStr("a", "b") == -1;
        assert iss.strStr("ab", "a") == 0;
        assert iss.strStr("ab", "b") == 1;
        assert iss.strStr("ab", "c") == -1;
        assert iss.strStr("abc", "ab") == 0;
        assert iss.strStr("abc", "abc") == 0;
        assert iss.strStr("abc", "bc") == 1;
        assert iss.strStr("abc", "c") == 2;
        assert iss.strStr("abcd", "a") == 0;
        assert iss.strStr("abcd", "b") == 1;
        assert iss.strStr("abcd", "c") == 2;
        assert iss.strStr("abcd", "d") == 3;
        assert iss.strStr("abcd", "e") == -1;
        assert iss.strStr("abcd", "ab") == 0;
        assert iss.strStr("abcd", "bc") == 1;
        assert iss.strStr("abcd", "cd") == 2;
        assert iss.strStr("abcd", "abc") == 0;
        assert iss.strStr("abcd", "bcd") == 1;
        assert iss.strStr("abcd", "abcd") == 0;
        assert iss.strStr("babba", "bbb") == -1;
    }

    @Test
    public void testError() throws Exception {
        String hayStack = "";
        String needle =   "";
        assert iss.strStr(hayStack, needle) == -1;
    }

    @Test
    public void testError2() throws Exception {
        assert iss.strStr("a", "") == 0;
    }

    @Test
    public void testSample() throws Exception {
        String str = "ABCDABD";
        int[] ints = iss.partialMatch(str, str.length());
        for (int i = 0; i != ints.length; i++) {
            System.out.print(ints[i]);
        }
    }
}
